import React from 'react'
import './Overview.css';

function Overview() {
  return (
    <div className="Overview">
        <div className='Text' id="Overview-Title">Optimizing your ship: equipping for success</div>
        <div className="Tip1">
            <video src='https://www.anno-expeditions.app/assets/pick_ship_v1-4ec0ec85.mp4' autoPlay></video>
            <div className='Text' id="Description">
                <h3 className='Text' id="Sub-title"></h3>
                <p className='Text' id="Paragraph"></p>
            </div>
        </div>
    </div>
  );
}

export default Overview;
